import styled from "styled-components"
import { ArrowLeft } from '@material-ui/icons';


const Container = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
`;

const Slider = () => {
  return (
    <Container>
      <Arrow><ArrowLeft></ArrowLeft></Arrow>
    </Container>
  )
}

export default Slider
